function ScoreComponent({score,totalQuestions}) {
   
    if(score>=3)
    {
        return
        (<div>
            You have scored {score} out of {totalQuestions}
        </div>)
    }
    else
    {
        return(
            <div>
             You have scored {score} out of {totalQuestions}
            </div>
        )
    }
  
}

export default ScoreComponent;
